import React from 'react'
import '/Users/pernilla/Documents/portfolio/portfolio/src/App.css';
import { Link } from 'react-router-dom';


function CardItem(props) {


    return (
        <>
            <li className="card_item">
                <Link className="card_item_link" to={props.path}>
                    <figure className="card_item_img_wrap" data-category={props.label}>
                        <img src={props.src} alt="img" className="card_item_img"></img>
                    </figure>
                    <div className="card_item_info">
                        <p className="card_item_text">{props.text}</p>
                    </div>
                </Link>
            </li>
        </>
    );
}

export default CardItem;
